import React from 'react';
import { observer } from 'mobx-react';
import cx from 'classnames';
import { Tooltip } from 'antd';
import { Rotate } from '../../../common/icons';
import store from '../../store/RootStore';
import i18n from '../../locales';

const ViewRotate = observer(() => {
  const { viewRotatable } = store.config;
  if (!viewRotatable) {
    return null;
  }
  return (
    <Tooltip placement="bottom" title={i18n.translate('CANVAS_ROTATE')}>
      <div
        className={cx('operation-icon', {
          'operation-icon--disabled': !store.initialized || store.readonly,
        })}
        onClick={() => {
          const { currentCamera, currentFrame, currentFrameRotation, setFrameRotation } = store.frame;
          let newRotation = currentFrameRotation - Math.PI / 2;
          if (newRotation <= -Math.PI) {
            newRotation += Math.PI * 2;
          }
          setFrameRotation(currentCamera, currentFrame, newRotation);
        }}
      >
        <Rotate />
      </div>
    </Tooltip>
  );
});

export default ViewRotate;
